/* ONE dark UI variables
** ---------------------------------------------- */
/* Official variables
** These variables must be defined in every theme
** Source: https://github.com/atom/atom/blob/master/static/variables/ui-variables.less
** ---------------------------------------------- */
/* Custom variables
** These variables are only used in this theme
** ---------------------------------------------- */
/* Packages variables
** These variables are used to override packages
** ---------------------------------------------- */
/* Debug
** Output variables to the top of the UI
** ------------------------------------- */
.incompatible-packages {
  background-color: #363731;
  overflow-y: scroll;
}
.incompatible-packages .incompatible-package {
  padding: 15px;
  margin-bottom: 10px;
  border-radius: 6px;
  border: 1px solid #d1d1d2;
  background-color: #fafafa;
  overflow: hidden;
}
.incompatible-packages .incompatible-package .badge {
  margin-left: 1em;
}
.incompatible-packages .incompatible-package .heading {
  margin-top: 0px;
}
.incompatible-packages .incompatible-package ul {
  padding-left: 1em;
}
.incompatible-packages .incompatible-package li {
  list-style-type: none;
}
.incompatible-packages .incompatible-package pre {
  margin-top: 2em;
  max-height: 25em;
  overflow: scroll;
  color: #ff6347;
}
.incompatible-packages-status {
  padding-left: 2px;
}
